import {Form, Button, Modal} from "react-bootstrap";
import React, { Component } from 'react'

export class QuestionAddModal extends Component {
    constructor(props) {
        super(props);
        this.numberOfQuest = props.numberOfQuest;
        this.onAddQuestionSubmit = this.onAddQuestionSubmit.bind(this);
    }

    render() {
        return (
            <Modal
                size="lg"
                aria-labelledby="contained-modal-title-vcenter"
                centered
            >
                <Modal.Header>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Thêm câu hỏi (câu {numberOfQuest + 1})
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    
                </Modal.Body>
                <Modal.Footer>
                <Button variant="outline-success" onClick={() => onAddQuestionSubmit}>Thêm</Button>
                </Modal.Footer>
            </Modal>
        )
    }
}

export default QuestionAddModal
